import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";
import UserProvider from "./store/providers/UserProvider";

import Home from "./pages/Home";
import RegisterForm from "./components/RegisterForm";
import LoginForm from "./components/LoginForm";
import PostForm from "./components/PostForm";
import PostProvider from "./store/providers/PostProvider";
import "./App.css";
import PostDetails from "./pages/PostDetails";

const App = () => {
  return (
    <div>
      <UserProvider>
        <PostProvider>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/login" component={LoginForm} />
            <Route path="/register" component={RegisterForm} />
            <Route path="/add-post" component={PostForm} />
            <Route path="/posts" component={Home} />
            <Route path="/posts/:title" component={PostDetails} />
            <Redirect to="/" from="/posts" />
          </Switch>
        </PostProvider>
      </UserProvider>
    </div>
  );
};

export default App;
